    "name": "template-permissions-dialog",
    "content": "<div class=\"modal-dialog\">\r\n    <div class=\"modal-content\">\r\n        <div class=\"modal-header\">\r\n            <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-hidden=\"true\">&times;</button>\r\n            <h4 class=\"modal-title\">Share template with people having the link</h4>\r\n        </div>\r\n        <div class=\"modal-body\">\r\n\r\n                <h5>Read permissions</h5>\r\n                <select id=\"readPermissions\" name=\"readPermissions\" multiple=\"multiple\">\r\n                    {{for ~getUsers()}}\r\n                    <option value=\"{{:_id}}\">{{:username}}</option>\r\n                    {{/for}}\r\n                </select>\r\n\r\n                <h5>Edit permissions</h5>\r\n                <select id=\"editPermissions\" name=\"editPermissions\" multiple=\"multiple\">\r\n                    {{for ~getUsers()}}\r\n                    <option value=\"{{:_id}}\">{{:username}}</option>\r\n                    {{/for}}\r\n                </select>\r\n\r\n        </div>\r\n        <div class=\"modal-footer\">\r\n            <button type=\"button\" class=\"btn btn-primary btn-sm\" id=\"okCommand\" data-dismiss=\"modal\">Ok</button>\r\n        </div>\r\n    </div>\r\n</div>"
