    "content": "<div class=\"input-group\">\r\n    <input type=\"text\" name=\"search\" id=\"search\" class=\"form-control datagrid-search-input\" />\r\n     <span class=\"input-group-addon\" class=\"datagrid-search-button\">\r\n        <i class=\"fa fa-search\"></i>\r\n    </span>\r\n</div>"
