    "content": "﻿<div class=\"navbar-header submenu\">\r\n    <ul class=\"nav navbar-nav sub-header\" id=\"extensionsToolbarBox\">\r\n        <li><a href=\"{{:~getServerUrl()}}reports/{{:_id}}/content\" download=\"{{:name}}.{{:fileExtension}}\" id=\"downloadCommand\"><i class=\"glyphicon glyphicon-cloud-download\"></i>Download</a></li>\r\n        <li><a id=\"openInNewPanelCommand\" href=\"{{:~getServerUrl()}}reports/{{:_id}}/content\" target=\"_blank\">\r\n                <i class=\"glyphicon glyphicon-sm glyphicon-fullscreen\"></i>Open in new panel\r\n            </a></li>\r\n        <li><a id=\"openTemplateCommand\" href=\"#/extension/templates/{{:templateShortid}}\">\r\n            <i class=\"glyphicon glyphicon-sm glyphicon-list-alt\"></i>Go to template</a></li>\r\n           \r\n    </ul>\r\n</div>"
